import React from 'react';

export default function Portfolio() {
    return (
        <section id="portCon">
            <section id='portRow'>
                <section className='portfolio'>
                    <h3 className='portTitle'>
                        beats collective
                    </h3>
                    <Image src={require('../browserHomePagejpg.jpg')}>

                    </Image>

                </section>
            </section>
        </section>
    );
}
